"signal_description": "The SIGNAL query is designed to extract data from the table named 'defaultview-545'. It first truncates the date to the month of the first 'Receive Invoice' event. This is then selected as 'Receive Invoice'. Next, it calculates the percentage of distinct 'Invoice ID' where the 'Last Invoice Reconciliation Status' is 'Reconciling' and the 'Last Invoice Submission Method' is 'PaperInvoice' over the total distinct 'Invoice ID' where the 'Last Invoice Reconciliation Status' is 'Reconciling'. This percentage is selected as 'Manual reconciled invoices Over Time'. The results are then ordered in ascending order by the 'Receive Invoice' column, with any null values appearing first. If there are any missing time series data for the month, it is filled with null values."
